import Header from './Header';

const Layout = ({ children, navigateToPage }) => {
  return (
    <div className="min-h-screen bg-gray-50">
      <Header navigateToPage={navigateToPage} />
      <div className="container mx-auto px-6 py-4">
        {children}
      </div>
    </div>
  );
};

export default Layout;
